import React from 'react';

import Stock from './Stock';

import './portfolio.css';


export default class portfolio extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            stockAmount: 0,
            stocks: []
        };
    }

    render(){
        return (
            <h1>This is the portfolios page</h1>
        );
    }


}

